import React from 'react';
import FoodForm from './FoodForm';

const AddFoodPage = ({ fetchFoods }) => {
  return (
    <div>
      <h1>Add Food</h1>
      <FoodForm fetchFoods={fetchFoods} />
    </div>
  );
};

export default AddFoodPage;
